window.bookSummaryJSON = "<p>Shadow's Fall, book four...the conclusion.</p> <p>\"I have tried to share everything. I have tried to hold nothing back. And so, I will tell you what happens next.</p> <p>You may judge me. You may cast your disapproval. You may call me fatalistic or dramatic. Weak. Or macabre.</p> <p>But you will never know. You will never understand. Because you have not lived my life.</p> <p>Find faults in my choices if you will, but this is what happened. Judge as you like, but know that my story does not require your permission.</p> <p>Do not forget that you are the one who decided to listen...\"</p> <p>Violet Archer knows that something is coming. She just doesn't know what...or who. And, oh boy, is she ever in for it.</p> <p>She will need to battle the Darkness - all which surrounds her - as well as all which lies within.</p> <p>And while she knows her heart, it will be tested. Left behind by one man. Pursued by another.</p> <p>She believes she is the hero of her story. But Violet is about to learn that some heroes turn into villains.</p> <p><b>Note:</b> Adult novel. Contains mature and explicit content.</p>"; 
